export default {data:{ThPnulcrVN:{id:"4",topic:"ซัมซุงรุกตลาดอีสปอร์ต ปั้นซับแบรนด์ Odyssey ตอกย้ำผู้นำอันดับหนึ่งเกมมิ่งมอนิเตอร์ระดับโลก",detail:"ซัมซุง ผู้นำอันดับหนึ่งของโลกในตลาดเกมมิ่งมอนิเตอร์ปี 2019 เปิดตัวซับแบรนด์ Odyssey (โอดิสซี) รุกตลาดเกมเต็มตัว พร้อมส่ง Odyssey G9 (โอดิสซี จี 9) สุดยอดนวัตกรรมจอโค้ง 1000R ที่ใหญ่ที่สุดในโลกขนาด 49 นิ้ว โดดเด่นด้วยดีไซน์แบบ Futuristic การันตีด้วยรางวัล CES Innovation Awards ปี 2020 และรุ่นน้องอย่าง Odyssey G7 (โอดิสซี จี 7) จอเกมสำหรับเกมเมอร์ตัวจริง",imageurl:"https:\u002F\u002Fwww.itgenius.co.th\u002Fassets\u002Ffrondend\u002Fimages\u002Fpicarticle\u002F28-8-2563%2014-42-57-2sgwuxf8dc9i.png",linkurl:"https:\u002F\u002Fbit.ly\u002F34NHTpP",created_at:"2020-09-29 11:16:50",status:"1"}},prerenderedAt:1671986920698}